import List from "./components/List";
import "./App.css";
function App() {
  const list = [
    {
      id: 1,
      task: "buy apples",
    },
    {
      id: 2,
      task: "wash car",
    },
  ];

  return (
    <div className="app">
      <h2>Let's get started!</h2>
      <div>
        <List items={list}></List>
      </div>
    </div>
  );
}

export default App;
